import React, { Component } from 'react';
import ask from './ask.png';
import send from './send.png';
import {Link, NavLink } from 'react-router-dom';

class AskSend extends Component {
  render() {
    return (
      <div>
      <div className="askSendContainer">
      <img src ={ask} className="askSendPic" alt="Ask for Healing"></img>
        <h4 className="askSendText">Ask For Healing</h4>
        <Link to="/healrequestform" >Heal Request</Link>
      </div>  
      <div className="askSendContainer">
        <img src={send} className="askSendPic"></img>
        <h4 className="askSendText" alt="Send Love">Send Healing</h4>
      </div>
      </div>
    )
  }
};

export default AskSend;
